import { Component } from "react";
import { BrowserRouter,Routes,Route,Path } from "react-router-dom";
import Home from './Components/Home'
class App extends Component{
  render(){
    return (
     <BrowserRouter>
      <Routes>
        <Route exact path="/" Component={Home}/>
      </Routes>
     </BrowserRouter>
    )
  }
}
export default App;
